import "./App.css";
import firebase from "firebase";
import HomeScene from "./Scenes/HomeScene";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import PollScene from "./Scenes/PollScene";

function App() {
  var firebaseConfig = {
    apiKey: "AIzaSyBcqFUsfCeh3S8xjGiMvqyUkevG1qTk74U",
    authDomain: "farmbuck3t-test.firebaseapp.com",
    projectId: "farmbuck3t-test",
    storageBucket: "farmbuck3t-test.appspot.com",
    messagingSenderId: "477902325836",
    appId: "1:477902325836:web:27adc2a7073c6ff0f80ce9",
    measurementId: "G-WYE8EYSVEB",
  };
  // Initialize Firebase
  if (!firebase.apps.length) {
    firebase.initializeApp(firebaseConfig);
  } else {
    firebase.app(); // if already initialized, use that one
  }
  firebase.analytics();
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path={`/poll/:pollId`}>
            <PollScene />
          </Route>
          <Route path="/">
            <HomeScene />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
